0438 \u0431\u044b\u0442\u044c \u0442\u043e\u043b\u044c\u043a\u043e \u0445\u043e\u043b\u043e\u0441\u0442\u044b\u0435 \u043d\u0435\u043c\u0435\u0446\u043a\u0438\u0435 \u043a\u0443\u043f\u0446\u044b. \u0420\u0430\u043d\u0435\u0435 \u0441\u0432\u043e\u0438\u043c \u043f\u043e\u043a\u0440\u043e\u0432\u0438\u0442\u0435\u043b\u0435\u043c \u043e\u043d\u0438 \u0441\u0447\u0438\u0442\u0430\u043b\u0438 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u0413\u0435\u043e\u0440\u0433\u0438\u044f, \u043d\u043e \u0437\u0430\u0442\u0435\u043c \u0438\u043c \u0441\u0442\u0430\u043b \u0441\u0432\u044f\u0442\u043e\u0439 \u041c\u0430\u0432\u0440\u0438\u043a\u0438\u0439, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0431\u044b\u043b \u0447\u0435\u0440\u043d\u043e\u043a\u043e\u0436\u0438\u043c. \u041e\u0442\u0441\u044e\u0434\u0430 \u0438 \u043f\u043e\u0448\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u0438\u0435 \u0447\u043b\u0435\u043d\u043e\u0432 \u0411\u0440\u0430\u0442\u0441\u0442\u0432\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1607_%D0%B3%D0%BE%D0%B4\" title=\"1607 \u0433\u043e\u0434\">1607<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%9C%D0%A1_%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D0%BE%D0%B2\" class=\"mw-redirect\" title=\"\u0412\u041c\u0421 \u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u043e\u0432\">\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u0441\u043a\u0438\u0439 \u0444\u043b\u043e\u0442<\/a> \u0443\u043d\u0438\u0447\u0442\u043e\u0436\u0430\u0435\u0442 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%93%D0%B8%D0%B1%D1%80%D0%B0%D0%BB%D1%82%D0%B0%D1%80%D0%B5_(1607)\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u0435 (1607)\">\u0411\u0438\u0442\u0432\u0435 \u043f\u0440\u0438 \u0413\u0438\u0431\u0440\u0430\u043b\u0442\u0430\u0440\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1626_%D0%B3%D0%BE%D0%B4\" title=\"1626 \u0433\u043e\u0434\">1626<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%94%D0%B5%D1%81%D1%81%D0%B0%D1%83\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0414\u0435\u0441\u0441\u0430\u0443\">\u0431\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0414\u0435\u0441\u0441\u0430\u0443<\/a>&#160;\u2014 \u0441\u0440\u0430\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B4%D1%86%D0%B0%D1%82%D0%B8%D0%BB%D0%B5%D1%82%D0%BD%D1%8F%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u044f\u044f \u0432\u043e\u0439\u043d\u0430\">\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u0438\u043b\u0435\u0442\u043d\u0435\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>. \u0410\u0440\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%B8%D0%B3%D0%B0_(1609)\" title=\"\u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043b\u0438\u0433\u0430 (1609)\">\u041a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u043b\u0438\u0433\u0438<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BB%D0%BB%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%90%D0%BB%D1%8C%D0%B1%D1%80%D0%B5%D1%85%D1%82_%D1%84%D0%BE%D0%BD\" title=\"\u0412\u0430\u043b\u043b\u0435\u043d\u0448\u0442\u0435\u0439\u043d, \u0410\u043b\u044c\u0431\u0440\u0435\u0445\u0442 \u0444\u043e\u043d\">\u0410\u043b\u044c\u0431\u0440\u0435\u0445\u0442\u0430 \u0444\u043e\u043d \u0412\u0430\u043b\u043b\u0435\u043d\u0448\u0442\u0430\u0439\u043d\u0430<\/a> \u043d\u0430\u043d\u0435\u0441\u043b\u0430 \u043f\u043e\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u043e\u0442\u0435\u0441\u0442\u0430\u043d\u0442\u0441\u043a\u0438\u043c \u0441\u0438\u043b\u0430\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u043c\u0438 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BD%D1%81%D1%84%D0%B5%D0%BB%D1%8C%D0%B4,_%D0%9F%D0%B5%D1%82%D1%80_%D0%AD%D1%80%D0%BD%D1%81%D1%82_II_%D1%84%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u041c\u0430\u043d\u0441\u0444\u0435\u043b\u044c\u0434, \u041f\u0435\u0442\u0440 \u042d\u0440\u043d\u0441\u0442 II \u0444\u043e\u043d\">\u042d\u0440\u043d\u0441\u0442 \u0444\u043e\u043d \u041c\u0430\u043d\u0441\u0444\u0435\u043b\u044c\u0434<\/a>.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1707\" class=\"mw-redirect\" title=\"1707\">1707<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B6%D0%B5%D0%B9%D0%BC%D1%81_%D0%A4%D0%B8%D1%82%D1%86%D0%B4%D0%B6%D0%B5%D0%B9%D0%BC%D1%81,_1-%D0%B9_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%91%D0%B5%D1%80%D0%B2%D0%B8%D0%BA\" title=\"\u0414\u0436\u0435\u0439\u043c\u0441 \u0424\u0438\u0442\u0446\u0434\u0436\u0435\u0439\u043c\u0441, 1-\u0439 \u0433\u0435\u0440\u0446\u043e\u0433 \u0411\u0435\u0440\u0432\u0438\u043a\">\u0414\u0436\u0435\u0439\u043c\u0441 \u0424\u0438\u0442\u0446\u0434\u0436\u0435\u0439\u043c\u0441, 1-\u0439 \u0433\u0435\u0440\u0446\u043e\u0433 \u0411\u0435\u0440\u0432\u0438\u043a<\/a> \u0432\u044b\u0438\u0433\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%90%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD%D1%81%D0%B5\" class=\"mw-redirect\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0410\u043b\u044c\u043c\u0430\u043d\u0441\u0435\">\u0431\u0438\u0442\u0432\u0443 \u043f\u0440\u0438 \u0410\u043b\u044c\u043c\u0430\u043d\u0441\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1719_%D0%B3%D0%BE%D0%B4\" title=\"1719 \u0433\u043e\u0434\">1719<\/a>&#160;\u2014 \u0412\u044b\u0445\u043e\u0434 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%BE%D0%BD%D0%B4%D0%BE%D0%BD\" title=\"\u041b\u043e\u043d\u0434\u043e\u043d\">\u041b\u043e\u043d\u0434\u043e\u043d\u0435<\/a> \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u0438\u0437\u0434\u0430\u043d\u0438\u044f \u0440\u043e\u043c\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B5%D1%84%D0%BE,_%D0%94%D0%B0%D0%BD%D0%B8%D1%8D%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u0414\u0435\u0444\u043e, \u0414\u0430\u043d\u0438\u044d\u043b\u044c\">\u0414\u0430\u043d\u0438\u044d\u043b\u044f \u0414\u0435\u0444\u043e<\/a> \u043f\u0440\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D0%B1%D0%B8%D0%BD%D0%B7%D0%BE%D0%BD_%D0%9A%D1%80%D1%83%D0%B7%D0%BE\" title=\"\u0420\u043e\u0431\u0438\u043d\u0437\u043e\u043d \u041a\u0440\u0443\u0437\u043e\">\u0420\u043e\u0431\u0438\u043d\u0437\u043e\u043d\u0430 \u041a\u0440\u0443\u0437\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1783_%D0%B3%D0%BE%D0%B4\" title=\"1783 \u0433\u043e\u0434\">1783<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%90%D0%BD%D0%BD%D0%BE%D0%BD&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0410\u043d\u043d\u043e\u043d (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0410\u043d\u043d\u043e\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044f<\/a>) \u0437\u0430\u043f\u0443\u0449\u0435\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0432\u043e\u0437\u0434\u0443\u0448\u043d\u044b\u0439 \u0448\u0430\u0440, \u043f\u043e\u0434\u043d\u0438\u043c\u0430\u044e\u0449\u0438\u0439\u0441\u044f \u0441 \u0433\u0440\u0443\u0437\u043e\u043c, \u0440\u0430\