e\u0440\u0435\u0445 \u0411\u0435\u043d\u0435\u0432\u0435\u043d\u0442\u043e\">\u041e\u0440\u0435\u0445 \u0411\u0435\u043d\u0435\u0432\u0435\u043d\u0442\u043e<\/a>\u00bb, \u0432\u0434\u043e\u0445\u043d\u043e\u0432\u0438\u0432\u0448\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D0%B3%D0%B0%D0%BD%D0%B8%D0%BD%D0%B8,_%D0%9D%D0%B8%D0%BA%D0%BA%D0%BE%D0%BB%D0%BE\" title=\"\u041f\u0430\u0433\u0430\u043d\u0438\u043d\u0438, \u041d\u0438\u043a\u043a\u043e\u043b\u043e\">\u041d\u0438\u043a\u043a\u043e\u043b\u043e \u041f\u0430\u0433\u0430\u043d\u0438\u043d\u0438<\/a> \u043d\u0430 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u0435 \u0432\u0430\u0440\u0438\u0430\u0446\u0438\u0439 \u0434\u043b\u044f \u0441\u043a\u0440\u0438\u043f\u043a\u0438 \u0441 \u043e\u0440\u043a\u0435\u0441\u0442\u0440\u043e\u043c \u00ab\u0412\u0435\u0434\u044c\u043c\u044b\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1816_%D0%B3%D0%BE%D0%B4\" title=\"1816 \u0433\u043e\u0434\">1816<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D1%80%D0%BE%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6_%D0%93%D0%BE%D1%80%D0%B4%D0%BE%D0%BD\" title=\"\u0411\u0430\u0439\u0440\u043e\u043d, \u0414\u0436\u043e\u0440\u0434\u0436 \u0413\u043e\u0440\u0434\u043e\u043d\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0411\u0430\u0439\u0440\u043e\u043d<\/a>, \u043f\u0440\u0435\u0441\u043b\u0435\u0434\u0443\u0435\u043c\u044b\u0439 \u043d\u0430 \u0440\u043e\u0434\u0438\u043d\u0435 \u043f\u043e\u0440\u043e\u0447\u0430\u0449\u0438\u043c\u0438 \u0435\u0433\u043e \u0441\u043b\u0443\u0445\u0430\u043c\u0438, \u043f\u043e\u043a\u0438\u043d\u0443\u043b \u0410\u043d\u0433\u043b\u0438\u044e. \u041a\u0430\u043a \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u044b\u044f\u0441\u043d\u0438\u043b\u043e\u0441\u044c, \u043d\u0430\u0432\u0441\u0435\u0433\u0434\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1823_%D0%B3%D0%BE%D0%B4\" title=\"1823 \u0433\u043e\u0434\">1823<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B8%D0%BB%D1%8C%D0%BD%D1%8E%D1%81\" title=\"\u0412\u0438\u043b\u044c\u043d\u044e\u0441\">\u0412\u0438\u043b\u044c\u043d\u0435<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%82%D0%B2%D0%B0\" title=\"\u041b\u0438\u0442\u0432\u0430\">\u041b\u0438\u0442\u0432\u0430<\/a>) \u043f\u043e \u043f\u0440\u0438\u043a\u0430\u0437\u0443 \u0433\u0435\u043d\u0435\u0440\u0430\u043b-\u0433\u0443\u0431\u0435\u0440\u043d\u0430\u0442\u043e\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9-%D0%9A%D0%BE%D1%80%D1%81%D0%B0%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0420\u0438\u043c\u0441\u043a\u0438\u0439-\u041a\u043e\u0440\u0441\u0430\u043a\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0420\u0438\u043c\u0441\u043a\u043e\u0433\u043e-\u041a\u043e\u0440\u0441\u0430\u043a\u043e\u0432\u0430<\/a> \u0438\u0441\u0442\u0440\u0435\u0431\u043b\u044f\u043b\u043e\u0441\u044c \u043c\u0430\u0441\u043e\u043d\u0441\u043a\u043e\u0435 \u0438\u043c\u0443\u0449\u0435\u0441\u0442\u0432\u043e: \u0432 \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438 \u043f\u043e\u043b\u0438\u0446\u0438\u0438 \u0441\u0436\u0438\u0433\u0430\u043b\u0438\u0441\u044c \u043f\u043e\u0434\u0441\u0432\u0435\u0447\u043d\u0438\u043a\u0438, \u0437\u0432\u0435\u0437\u0434\u044b, \u0447\u0435\u0440\u0435\u043f\u0430 \u0438 \u0434\u0440\u0443\u0433\u0438\u0435 \u0440\u0438\u0442\u0443\u0430\u043b\u044c\u043d\u044b\u0435 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u044b \u0438 \u0434\u0435\u043a\u043e\u0440\u0430\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1826_%D0%B3%D0%BE%D0%B4\" title=\"1826 \u0433\u043e\u0434\">1826<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BD%D0%B3%D0%BB%D0%B8%D1%8F\" title=\"\u0410\u043d\u0433\u043b\u0438\u044f\">\u0410\u043d\u0433\u043b\u0438\u0438<\/a> \u0437\u0430<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%82%D0%B5%D0%BD%D1%82\" title=\"\u041f\u0430\u0442\u0435\u043d\u0442\">\u043f\u0430\u0442\u0435\u043d\u0442\u043e\u0432\u0430\u043d<\/a> \u043f\u0435\u0440\u0432\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C\" title=\"\u0410\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\">\u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B2%D0%B8%D0%B3%D0%B0%D1%82%D0%B5%D0%BB%D1%8C_%D0%B2%D0%BD%D1%83%D1%82%D1%80%D0%B5%D0%BD%D0%BD%D0%B5%D0%B3%D0%BE_%D1%81%D0%B3%D0%BE%D1%80%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0414\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u044c \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0435\u0433\u043e \u0441\u0433\u043e\u0440\u0430\u043d\u0438\u044f\">\u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u0435\u043c \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0435\u0433\u043e \u0441\u0433\u043e\u0440\u0430\u043d\u0438\u044f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1839_%D0%B3%D0%BE%D0%B4\" title=\"1839 \u0433\u043e\u0434\">1839<\/a>&#160;\u2014 \u0412\u0441\u0442\u0443\u043f\u043b\u0435\u043d\u0438\u0435 \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u0440\u043c\u0438\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B4%D0%B0%D0%B3%D0%B0%D1%80\" title=\"\u041a\u0430\u043d\u0434\u0430\u0433\u0430\u0440\">\u041a\u0430\u043d\u0434\u0430\u0433\u0430\u0440<\/a> (\u043d\u044b\u043d\u0435&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_I\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I\">\u041d\u0438\u043a\u043e\u043b\u0430\u0439 I<\/a> \u043f\u043e\u0432\u0435\u043b\u0435\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u0442\u044c \u0438\u043c\u0435\u043d\u0430 \u0432\u0441\u0435\u0445 \u043a\u0430\u0432\u0430\u043b\u0435\u0440\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%B2%D1%8F%D1%82%D0%BE%D0%B3%D0%BE_%D0%93%D0%B5%D0%BE%D1%80%D0%B3%D0%B8%D1%8F\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u0432\u044f\u0442\u043e\u0433\u043e \u0413\u0435\u043e\u0440\u0433\u0438\u044f\">\u043e\u0440\u0434\u0435\u043d\u0430 \u0413\u0435\u043e\u0440\u0433\u0438\u044f<\/a> \u043d\u0430 \u043f\u0430\u043c\u044f\u0442\u043d\u044b\u0445 \u0434\u043e\u0441\u043a\u0430\u0445 \u0413\u0435\u043e\u0440\u0433\u0438\u0435\u0432\u0441\u043a\u043e\u0433\u043e \u0437\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D1%8C%D1%88%D0%BE%D0%B9_%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%91%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B4%D0%B2%D0%BE%D1%80%D0%B5%D1%86\" title=\"\u0411\u043e\u043b\u044c\u0448\u043e\u0439 \u041a\u0440\u0435\u043c\u043b\u0451\u0432\u0441\u043a\u0438\u0439 \u0434\u0432\u043e\u0440\u0435\u0446\">\u0411\u043e\u043b\u044c\u0448\u043e\u0433\u043e \u041a\u0440\u0435\u043c\u043b\u0451\u0432\u0441\u043a\u043e\u0433\u043e \u0434\u0432\u043e\u0440\u0446\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1859_%D0%B3%D0%BE%D0%B4\" title=\"1859 \u0433\u043e\u0434\">1859<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D1%80%D1%82-%D0%A1%D0%B0%D0%B8%D0%B4\" title=\"\u041f\u043e\u0440\u0442-\u0421\u0430\u0438\u0434\">\u041f\u043e\u0440\u0442-\u0421\u0430\u0438\u0434\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%83%D1%8D%D1%86%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB\" title=\"\u0421\u0443\u044d\u0446\u043a\u0438\u0439 \u043a\u0430\u043d\u0430\u043b\">\u0421\u0443\u044d\u0446\u043a\u043e\u0433\u043e \u043a\u0430\u043d\u0430\u043b\u0430<\/a> \u043f\u043e\u0434 \u0440\u0443\u043a\u043e\u0432\u043e\u0434\u0441\u0442\u0432\u043e\u043c \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u043e\u0433\u043e \u0438\u043d\u0436\u0435\u043d\u0435\u0440\u0430 \u0438 \u0434\u0438\u043f\u043b\u043e\u043c\u0430\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B5%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BD%D0%B4_%D0%9B%D0%B5%D1%81%D1%81%D0%B5%D0%BF%D1%81\" class=\"mw-redirect\" title=\"\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434 \u041b\u0435\u0441\u0441\u0435\u043f\u0441\">\u0424\u0435\u0440\u0434\u0438\u043d\u0430\u043d\u0434\u0430 \u041b\u0435\u0441\u0441\u0435\u043f\u0441\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1865_%D0%B3%D0%BE%D0%B4\" title=\"1865 \u0433\u043e\u0434\">1865<\/a>&#160;\u2014 \u041f\u0430\u043f\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B9_IX\" title=\"\u041f\u0438\u0439 IX\">\u041f\u0438\u0439 IX<\/a> \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D1%81%D1%82,_%D0%A4%D0%B5%D1%80%D0%B5%D0%BD%D1%86\" title=\"\u041b\u0438\u0441\u0442, \u0424\u0435\u0440\u0435\u043d\u0446\">\u0424\u0435\u0440\u0435\u043d\u0446\u0430 \u041b\u0438\u0441\u0442\u0430<\/a> \u0432 \u0441\u0430\u043d\u0435 \u0430\u0431\u0431\u0430\u0442\u0430 (\u041b\u0438\u0441\u0442 \u043f\u0440\u0438\u043d\u044f\u043b \u043c\u0430\u043b\u044b\u0439 \u043f\u043e\u0441\u0442\u0440\u0438\u0433 \u0438 \u04