2\u0430\u0436\u043d\u043e\u0439 \u043f\u0430\u0440\u043a\u043e\u0432\u043a\u0438. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 107 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2007_%D0%B3%D0%BE%D0%B4\" title=\"2007 \u0433\u043e\u0434\">2007<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BC%D0%B5%D1%80%D1%82%D1%8C_%D0%B8_%D0%BF%D0%BE%D1%85%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%B0_%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD%D0%B0\" title=\"\u0421\u043c\u0435\u0440\u0442\u044c \u0438 \u043f\u043e\u0445\u043e\u0440\u043e\u043d\u044b \u0411\u043e\u0440\u0438\u0441\u0430 \u0415\u043b\u044c\u0446\u0438\u043d\u0430\">\u043f\u043e\u0445\u043e\u0440\u043e\u043d\u044b \u043f\u0435\u0440\u0432\u043e\u0433\u043e \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 \u0420\u043e\u0441\u0441\u0438\u0438<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BB%D1%8C%D1%86%D0%B8%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0415\u043b\u044c\u0446\u0438\u043d, \u0411\u043e\u0440\u0438\u0441 \u041d\u0438\u043a\u043e\u043b\u0430\u0435\u0432\u0438\u0447\">\u0411.&#160;\u041d.&#160;\u0415\u043b\u044c\u0446\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2015_%D0%B3%D0%BE%D0%B4\" title=\"2015 \u0433\u043e\u0434\">2015<\/a>&#160;\u2014 \u0432 \u041d\u0435\u043f\u0430\u043b\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B5%D0%BC%D0%BB%D0%B5%D1%82%D1%80%D1%8F%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B2_%D0%9D%D0%B5%D0%BF%D0%B0%D0%BB%D0%B5_(2015)\" title=\"\u0417\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f \u0432 \u041d\u0435\u043f\u0430\u043b\u0435 (2015)\">\u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u0435<\/a> \u043c\u0430\u0433\u043d\u0438\u0442\u0443\u0434\u043e\u0439 7,8 Mw . \u041f\u043e\u0432\u0442\u043e\u0440\u043d\u044b\u0435 \u0437\u0435\u043c\u043b\u0435\u0442\u0440\u044f\u0441\u0435\u043d\u0438\u044f \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u043b\u0438\u0441\u044c \u0434\u043e 28 \u0430\u043f\u0440\u0435\u043b\u044f. \u0412 \u041d\u0435\u043f\u0430\u043b\u0435 \u043f\u043e\u0433\u0438\u0431 8151 \u0447\u0435\u043b\u043e\u0432\u0435\u043a, 17 868 \u0440\u0430\u043d\u0435\u043d\u044b , \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043b\u0438 8&#160;\u043c\u043b\u043d \u0447\u0435\u043b\u043e\u0432\u0435\u043a . \u0412 \u0418\u043d\u0434\u0438\u0438 69 \u0447\u0435\u043b\u043e\u0432\u0435\u043a \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u0438 \u043e\u043a\u043e\u043b\u043e 270 \u0440\u0430\u043d\u0435\u043d\u044b . \u0412 \u041a\u0438\u0442\u0430\u0435 25 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445, 117 \u0440\u0430\u043d\u0435\u043d\u044b\u0445 .<\/li><\/ul><h2>"}